import React, { useState } from 'react';
import './App.css';

function App() {
  const [tasks, setTasks] = useState([]);
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [timeSlot, setTimeSlot] = useState('');
  const [isImportant, setIsImportant] = useState(false);
  const [sortType, setSortType] = useState('latest');

  const handleAddTask = () => {
    if (!title || !description || !timeSlot) return;
    const newTask = {
      id: Date.now(),
      title,
      description,
      timeSlot,
      isImportant,
      isCompleted: false,
      createdAt: new Date().toLocaleString(),
    };
    setTasks([newTask, ...tasks]);
    setTitle('');
    setDescription('');
    setTimeSlot('');
    setIsImportant(false);
  };

  const handleDelete = (id) => {
    setTasks(tasks.filter(task => task.id !== id));
  };

  const toggleComplete = (id) => {
    setTasks(tasks.map(task => task.id === id ? { ...task, isCompleted: !task.isCompleted } : task));
  };

  const sortedTasks = [...tasks].sort((a, b) => {
    if (sortType === 'important') return b.isImportant - a.isImportant;
    return new Date(b.createdAt) - new Date(a.createdAt);
  });

  return (
    <div className="app-container">
      <h1>üìù Task Manager</h1>

      <div className="input-group">
        <input
          type="text"
          placeholder="Title"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
        />
        <input
          type="text"
          placeholder="Description"
          value={description}
          onChange={(e) => setDescription(e.target.value)}
        />
        <input
          type="time"
          value={timeSlot}
          onChange={(e) => setTimeSlot(e.target.value)}
        />
        <label className="important-check">
          <input
            type="checkbox"
            checked={isImportant}
            onChange={(e) => setIsImportant(e.target.checked)}
          />
          Mark as Important
        </label>
        <button onClick={handleAddTask}>‚ûï Add Task</button>
      </div>

      <div className="sort-options">
        <label>Sort by: </label>
        <select value={sortType} onChange={(e) => setSortType(e.target.value)}>
          <option value="latest">Latest</option>
          <option value="important">Important First</option>
        </select>
      </div>

      <ul className="task-list">
        {sortedTasks.map(task => (
          <li key={task.id} className={task.isCompleted ? 'completed' : ''}>
            <div className="task-info">
              <input
                type="checkbox"
                checked={task.isCompleted}
                onChange={() => toggleComplete(task.id)}
              />
              <div>
                <strong>{task.title}</strong> - {task.description}
                <div className="timestamp">üïí {task.createdAt}</div>
                <div>‚è∞ Time Slot: {task.timeSlot}</div>
                {task.isImportant && <div className="important">‚ö†Ô∏è Important</div>}
              </div>
            </div>
            <button className="delete-btn" onClick={() => handleDelete(task.id)}>‚ùå</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
